import pprint

inputs = ""

letters = "abcdefghijklmnopqrstuvwxyz"
pairs = [c + c.upper() for c in letters] + [c.upper() + c for c in letters]


def react(polymer: str):
    before = polymer
    after = polymer
    while True:
        for p in pairs:
            after = after.replace(p, "")
        if before == after:
            return after
        before = after


print(len(react(inputs)))

results = {}
for letter in letters:
    single = inputs.replace(letter.lower(), "")
    single = single.replace(letter.upper(), "")
    results[letter] = len(react(single))


pprint.pprint(results)
